package main

import (
	"fmt"
	"html/template"
	"io/ioutil"
	"log"
	"math/rand"
	"net/http"
	"os"
	"strings"
	"time"
)

// Quote endpoint
const quoteURL = "https://raw.githubusercontent.com/AntJanus/programmers-proverbs/master/README.md"

const tmpl = `{{define "index"}}<!DOCTYPE html>
<html lang="en" style="height:100%">
<head>
	<title>{{.title}}</title>
	<link href="data:image/png;base64,
" rel="icon" type="image/png" />
	<style>
		* {
			margin: 0;
			border: 0;
			padding: 0;
			outline: none;
		}
		body {
			height: 100%;
			box-sizing:border-box;
			display: flex;
			justify-content: center;
			align-items: center;
			padding: 64px;
			-webkit-font-smoothing: antialiased;
			-moz-osx-font-smoothing: grayscale;
			background: #98ddff57 url('data:image/png;base64,') bottom center no-repeat;
		}
		.proverb {
			font-size: 64px;
			letter-spacing: 1.5px;
			opacity: 0.8;
			line-height: 1.3em;
			text-align: center;
		}
		.proverb:before {
			content: '”';
			font-size: 256px;
			color: rgba(0,0,0,0.5);
		}
		.credits {
			position: fixed;
			bottom: 24px;
			right: 36px;
			text-alight: right;
			font-family: monospace;
		}
		.credits a {
			text-decoration: none;
			padding: 12px 0;
			color: black;
			display: inline-block;
			font-weight: bold;
			letter-spacing: .5px;
			border-bottom: 1px solid rgba(1,1,1,0);
		}
		.credits a:hover {
			color: orange;
			border-bottom: 1px solid orange;
		}
		.div {
			opacity: 0.3;
		}
		.host {
			opacity: 0.8;
		}
	</style>
</head>
<body>
	<blockquote class="proverb">
		{{.proverb}}
	</blockquote>

	<div class="credits">
		<p>
			<a href="https://github.com/penzur/amigo" target="_blank">CHECK OUT CODE ON GITHUB</a>
			<span class="div">|</span>
			<span class="host">{{.hostname}}</span>
		</p>
	</div>
</body>
</html>{{end}}`

func main() {
	rand.Seed(time.Now().UnixNano())
	host, _ := os.Hostname()
	port := os.Getenv("PORT")

	if port == "" {
		port = "8080"
	}

	http.HandleFunc("/", func(w http.ResponseWriter, r *http.Request) {
		now := time.Now()
		proverb := ""

		resp, err := http.Get(quoteURL)
		if err == nil {
			b, _ := ioutil.ReadAll(resp.Body)
			raw := strings.Split(string(b), "## Proverbs")

			if len(raw) > 1 {
				proverbs := strings.Split(raw[1], "***")
				randomNumber := rand.Intn(len(proverbs))
				proverb = strings.Replace(proverbs[randomNumber], "#### ", "", -1)
			}
		}

		t, _ := template.New("amigo").Parse(tmpl)
		_ = t.ExecuteTemplate(w, "index", map[string]interface {
		}{
			"title":    "Amigo's Programming Proverbs",
			"hostname": host,
			"proverb":  proverb,
		})

		elapse := time.Since(now) / time.Millisecond
		log.Printf("%s %s 200 %dms\n", r.Method, r.RequestURI, elapse)
	})

	log.Println(fmt.Sprintf("Server running on %s:%s", host, port))

	if err := http.ListenAndServe(fmt.Sprintf(":%s", port), nil); err != nil {
		panic(err)
	}
}
